ror, como que se tilde, se cierre o se pierda la conexión a Internet, ¡no te preocupes!\",\"   \",\"Tu saldo y premios se actualizan automáticamente en nuestra base de datos *en el momento en que ocurren*.\",\"    \",\"Así podrás seguir disfrutando de la emoción del juego sin interrupciones. 😊🎰\"],[\"🔄 *OTRA CONSULTA:*\",\"\",\"Si tu consulta no se encuentra dentro de las opciones anteriores, no dudes en comunicarte al https://wa.me/<human_support_placeholder>?text=Hola.\",\"\",\"Sin embargo, ten en cuenta que nuestros agentes pueden estar ocupados con muchos mensajes. Para obtener una respuesta más rápida, envíanos un mensaje a ese número con tu usuario o correo electrónico en la parte superior y, debajo, detalla tu consulta.\",\"\",\"¡Nos pondremos en contacto contigo lo antes posible! 🚀✉️ ¡Gracias por tu comprensión! 😊\"]]]',	0,	0,	'main'),
